import React from 'react';
import { useNavigate } from 'react-router-dom';
// Ensure Tailwind CSS is correctly imported in your project setup
import Navbar from "../navbar/Navbar.jsx";


function Login() {
    // Prevent form submission for demonstration purposes
    const handleLogin = (event) => {
      event.preventDefault();
      // Here you would typically handle the login logic
    };

return (
    <div className="flex flex-wrap h-screen">
        {/* Login Section */}
        <div className="w-full md:w-1/2 flex flex-col">
        <div className="flex justify-center md:justify-start pt-12 md:pl-12 md:-mb-24">
            <a href="#" className="bg-black text-white font-bold text-xl p-4">Logo</a>
        </div>

        <div className="flex flex-col justify-center md:justify-start my-auto pt-8 md:pt-0 px-8 md:px-24 lg:px-32">
            <p className="text-center text-3xl">Welcome.</p>
            <form className="flex flex-col pt-3 md:pt-8" onSubmit={handleLogin}>
            <div className="flex flex-col pt-4">
                <label htmlFor="email" className="text-lg">Email</label>
                <input type="email" id="email" placeholder="your@email.com" className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" />
            </div>

            <div className="flex flex-col pt-4">
                <label htmlFor="password" className="text-lg">Password</label>
                <input type="password" id="password" placeholder="Password" className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" />
            </div>

            <button type="submit" className="bg-black text-white font-bold text-lg hover:bg-gray-700 p-2 mt-8">Log In</button>
            </form>
            <div className="text-center pt-12 pb-12">
            <p>Don't have an account? <a href="/register" className="underline font-semibold">Register here.</a></p>
            </div>
        </div>
        </div>

        {/* Image Section */}
        <div className="w-1/2 hidden md:block">
        <img className="object-cover w-full h-screen" src="https://source.unsplash.com/IXUM4cJynP0" alt="Login Background" />
        </div>
    </div>
    );
}

export default Login;
